import React from 'react';
import './TeamHeader.css';

const TeamHeader = ({ teamName, members, activeTab, onTabChange }) => {
  return (
    <div className="team-header">
      <h1>{teamName}</h1>
      <div className="team-members">
        {members.map((member, index) => (
          <span key={index}>{member.username}</span>
        ))}
      </div>
      <div className="tabs">
        <button onClick={() => onTabChange('Introduce')}>Introduce</button>
        <button onClick={() => onTabChange('Team task')}>Team Task</button>
      </div>
    </div>
  );
};

export default TeamHeader;
